// Orange domain specified by user.        this.iconColorOffset_ = this.orangeOffset_;    } else if (blueIconDomain && (location.href.indexOf(blueIconDomain) != -1 || user_email.indexOf(blueIconDomain) != -1)) {        // Blue domain specified by user.        this.iconColorOffset_ = this.blueOffset_;    } else if (location.href.indexOf('/a/') != -1) {        // Hosted domain (Blue by default).        this.iconColorOffset_ = this.blueOffset_;    }    // Checks every second for a change in the unread count.    var timer = setInterval(this.poll_, pollDurationMS);    this.poll_();    return true;}var initialized = false;function initialize() {    if (!initialized) {        // Timeout needed to ensure gmail API object is fully initialized.        setTimeout(function() {            initialized = new EpFavIconUnreadCount();        }, 0);    }}initialize();